import classNames from "classnames/bind";

import styles from "./Home.module.scss";

const cx  = classNames.bind(styles);
function Home() {
    return ( 
        <section className={cx("message")}>
            <article className={cx("title")} >
                <p className={cx("nameTitle")}>Khanh Dinh Van</p>
                <h1 className={cx("titleMessage")}>THÔNG TIN LỚP HỌC MÔN CHÍNH TRỊ - LỚP VIE1016.25 - THẦY KHANHDV10</h1>
            </article>
            <section className={cx("container")} >
                <article className={cx("itemTilteMessage")}>
                    <h1 >THÔNG TIN LỚP HỌC MÔN CHÍNH TRỊ - LỚP VIE1016.25 - THẦY KHANHDV10</h1>
                </article>
                <article className={cx("itemAccountReceiver")}>
                    <span >
Khanh Dinh Van</span>
                </article>

            </section>
        </section>
     );
}

export default Home;
